import React from "react";
import Layout from "../components/Layout";

// Componente da página de Metas
const Metas = () => {
  return (
    // Envolve a página com o layout padrão (sidebar + header)
    <Layout>
      {/* Conteúdo principal da página */}
      <h2>Página de Metas</h2>
      <p>Estabeleça e acompanhe suas metas financeiras aqui.</p>
    </Layout>
  );
};

export default Metas;
